export default function Topbar() {
  return (
    <header>
      <h3>S O M E S H</h3>
      <nav>
        <a href="#home">Home</a>
        <a href="#services">Services</a>
        <a href="#aboutme">About Me</a>
        <a href="#contact">Contact</a>
      </nav>
    </header>
  );
}
